$(document).ready(function(){
  $(".star-rating").click(function() {
    $("#rated").rating("refresh", {disabled:true, showClear:false});

      var user_id = $(this).attr('data-user-id');
      var vote = $(this).attr('value');
    console.logog(vote);
    $.ajax({
      type: 'post',
      url: '/users/' + user_id + '/rate',
      data: {rating: vote}
    });
  });
})
